const ImageDesktop = {
  desktop: {
    image1: require("../images/desktop/image-deep-earth.jpg").default,
    image2: require("../images/desktop/image-night-arcade.jpg").default,
    image3: require("../images/desktop/image-soccer-team.jpg").default,
    image4: require("../images/desktop/image-grid.jpg").default,
    image5: require("../images/desktop/image-from-above.jpg").default,
    image6: require("../images/desktop/image-pocket-borealis.jpg").default,
    image7: require("../images/desktop/image-curiosity.jpg").default,
    image8: require("../images/desktop/image-fisheye.jpg").default,
  }
};

export default ImageDesktop;
